import PopUpCardSearch from "./PopUpCardSearch";
import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";
export default function PetCardSearch(props) {
  const [showPopUp, setShowPopUp] = useState(false);
  [
    {
        "_id": "63f9f711b2ac0c536433a982",
        "type": "dog",
        "name": "Chance",
        "height": "40cm",
        "weight": "2.5 kg",
        "color": "off white",
        "bio": "bio",
        "age": 4,
        "Hypoallergenic": false,
        "dietary_restrictions": "no fish",
        "breed": "American Bulldog",
        "join_date": {
            "$timestamp": "7204059709140107265"
        },
        "last_update": {
            "$timestamp": "7204059709140107266"
        },
        "wight": null,
        "picture": "https://static.tvtropes.org/pmwiki/pub/images/homeward_bound_disneyscreencapscom_9020.jpg",
        "adoption_status": "Available"
    },



]

  return (

    <Card style={{ width: "18rem" }}>
         <Line addClass="around">
           <img className="dogProfilePicture" src={props.pet.picture} />
         </Line>
      <Card.Body>
        <Card.Title>{props.pet.name}</Card.Title>
        <Line addClass="between">
          <h5>{props.pet.breed}</h5>
          <Rows addClass="between">
            <h6>Bio:{props.pet.bio}</h6>
            <h6>Age:{props.pet.age}</h6>
          </Rows>
        </Line>
        <Card.Text>
          {props.pet.adoption_status}
        </Card.Text>

        <Button variant="primary">Go somewhere</Button>
      </Card.Body>
    </Card>
  );
}

